        function BindPos() {
            var jqxhr = $.getJSON("http://webapi.branix.com/api/Gps/FE7A7ABE-813E-4184-81E1-2FE016D729D5/Position/C64416")
             .done(function (data) {
                 for (i = 0; i < data.totalItemsCount; i++) {
                     createMarker(data.items[i]);
                 }
             })
            .fail(function () {
                console.log("error");
            })

            jqxhr.complete(function () {
                setTimeout(timer, 30000);
            });
        }


        function createMarker(data) {
            $('#my_map').gmap3({
                clear: {
                    id: data.uid,
                    id: 'o' + data.uid
                }
            });
            var fUTC = new moment('1970-01-01').add('s', data.pos.t);//.format("MM/DD/YYYY HH:mm:ss");
            var dUTC = moment().add('h', 8);//.format("MM/DD/YYYY HH:mm:ss");
            var latlng = [data.pos.y, data.pos.x];
            $('#my_map').gmap3({
                marker: {
                    latLng: latlng, id: data.uid, options: {
                        icon: "images/icon.png",
                        zIndex: 999999, optimized: true
                    }
                },
                overlay: {
                    id: 'o' + data.uid,
                    latLng: latlng,
                    options: {
                        content: '<div class="infobox">' +
                        '' + dUTC.diff(fUTC, 'minutes') + ' min ago<br/>' +
                        '' + data.nm + '<br/>' +
                        '' + ~~(data.pos.s / 1.609344) + ' mph' +
                        '</div>',
                        offset: {
                            y: -85,
                            x: -35
                        }
                    }
                }
            });
            if (autof == 1)
                $('#my_map').gmap3('get').panTo(new google.maps.LatLng(data.pos.y, data.pos.x));
        }

